(1, 'Default Template', '<html>\r\n\r\n<link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Open+Sans:300,600">\r\n<meta http-equiv="content-type" content="text/html; charset=UTF-8">\r\n\r\n<style>\r\n\r\nbody {\r\n  /*padding: 20px 80px 20px 20px;*/\r\n  font-family: "Source Sans Pro", sans-serif;\r\n}\r\n\r\nh2 {\r\n  margin-top: 0;\r\n}\r\n\r\n.images img {\r\n  max-width: 400px;\r\n}\r\n\r\n.store_desc {\r\n  min-width: 800px;\r\n  text-align: center;\r\n  border-top: 1px solid #333;\r\n  border-bottom: 1px solid #333;\r\n  background-color: #D9F0FF;\r\n  margin: 40px 0 20px\r\n}\r\n\r\n.third {\r\n  width: 30%;\r\n  display: inline-block;\r\n  padding: 10px 1.5% 10px;\r\n  margin: 40px 0 40px;\r\n  text-align: center;\r\n}\r\n\r\n.tt {\r\n  font-size: 1.4em;\r\n  padding-bottom: 10px;\r\n}\r\n\r\n.col_left {\r\n  position: absolute;\r\n}\r\n\r\n.col_right {\r\n  margin-left: 400px;\r\n  min-height: 520px;\r\n  min-width: 400px;\r\n}\r\n\r\n.images img {\r\n  max-height: 520px;\r\n  max-width: 380px;\r\n}\r\n\r\n</style>\r\n\r\n<h1>{{title}}</h1>\r\n\r\n<hr>\r\n<br>\r\n\r\n<div class="two_col minwidth">\r\n\r\n <!-- Zinc EPID: {{asin}} -->\r\n <!-- PyN -->\r\n\r\n  <div class="col col_left">\r\n    <div class="images">\r\n      <img src={{main_image}}>\r\n    </div>\r\n  </div>\r\n\r\n  <div class="col col_right">\r\n    <div class="description">\r\n      <h2>Product Details</h2>\r\n      <h3>\r\n        {{variant_specifics}}\r\n      </h3>\r\n      <ul>\r\n        {{product_details}}\r\n      </ul>\r\n      <ul>\r\n        {{feature_bullets}}          \r\n      </ul>\r\n      <p>\r\n        {{post_description}}\r\n      </p>\r\n      <p>\r\n        {{{product_description}}}\r\n      </p>\r\n    </div>\r\n  </div>\r\n\r\n</div>\r\n\r\n</html>\r\n', 'default', 1),
