ms qualify for returns within 14 - 30 days of receipt. Buyer is responsible for return shipping on any item that is not damaged</li> \r\n	<li>Please be sure this is an item you want before making your purchase. Customer Satisfaction is our TOP priority!</li> \r\n	<li>All items are IN STOCK at time of listing.</li> \r\n	<li>Inventory on eBay changes constantly and it is impossible to maintain a perfectly accurate count of all items.</li> \r\n	<li>Please do not penalize us if we have to issue you a refund!</li> \r\n</ul> \r\n\r\n<br> <br>\r\n<h1 align="center">Thank You For Your Business!</h1> <!-- Zinc EPID: {{asin}} -->\r\n\r\n</html>\r\n\r\n\r\n', 'alternative', 0),
(3, 'Modern Template', '<meta charset="utf-8">\r\n<meta http-equiv="X-UA-Compatible" content="IE=edge">\r\n<meta name="viewport" content="width=device-width, initial-scale=1">\r\n<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.4/css/bootstrap.min.css">\r\n\r\n<div class="container">\r\n  <h1>{{title}}</h1>\r\n  <img src={{main_image}} style="max-width: 512px;">\r\n  <h3><span class="glyphicon glyphicon-list-alt"></span> Description</h3>\r\n  <p>{{{product_description}}}</p>\r\n  <p>Features:</p>\r\n  <ul>\r\n    {{feature_bullets}}\r\n  </ul>\r\n\r\n  <p>Product Details:</p>\r\n  <ul>\r\n    {{product_details}}\r\n  </ul>\r\n\r\n  <ul class="list-unstyled">\r\n    <li>\r\n      <h3><span class="glyphicon glyphicon-time"></span> Handling</h3>\r\n      <p>We will ship all orders within <mark>3 business day</mark> of payment.</p>\r\n    </li>\r\n    <li>\r\n      <h3><span class="glyphicon glyphicon-send"></span> Delivery</h3>\r\n      We Do Not Ship Outside of the Continental US.\r\n    </li>\r\n    <li>\r\n      <h3><span class="glyphicon glyphicon-ok-circle"></span> Return Policy</h3>\r\n      All items qualify for returns within 30 days of receipt. Buyer is responsible for return shipping on any item that is not damaged.\r\n    </li>\r\n    <li>\r\n      <h3><span class="glyphicon glyphicon-comment"></span> Feedback</h3>\r\n      <p>We take our reputation seriously, we buy and sell online, so we understand the value of trust. <mark>If you are unsatisfied with your order, please contact us</mark> and we will work with you to resolve it to your satisfaction.</p>\r\n    </li>\r\n  </ul>\r\n</div>\r\n', 'modern', 0);

