--
-- Table structure for table `products`
--

CREATE TABLE `products` (
  `id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `source_id` int(11) NOT NULL,
  `asin_no` varchar(25) NOT NULL,
  `sku` varchar(50) DEFAULT NULL,
  `a_cat_id` bigint(20) NOT NULL,
  `pageurl` text NOT NULL,
  `title` varchar(255) DEFAULT NULL,
  `mpn` varchar(255) DEFAULT NULL,
  `upc` varchar(255) DEFAULT NULL,
  `main_image` varchar(255) DEFAULT NULL,
  `image_set` longtext,
  `binding` varchar(255) DEFAULT NULL,
  `brand` varchar(255) DEFAULT NULL,
  `item_specification` text,
  `color` varchar(255) DEFAULT NULL,
  `features` longtext,
  `item_dimension` longtext,
  `currency_code` varchar(50) DEFAULT NULL,
  `list_amount` varchar(50) DEFAULT NULL,
  `new_amount` varchar(50) DEFAULT NULL,
  `sale_amount` varchar(50) DEFAULT NULL,
  `save_amount` varchar(255) DEFAULT NULL,
  `model` varchar(255) DEFAULT NULL,
  `product_group` varchar(255) DEFAULT NULL,
  `warranty` varchar(255) DEFAULT NULL,
  `description` longtext,
  `variations_dimentions` text NOT NULL,
  `variations_items` text NOT NULL,
  `variations_images` text NOT NULL,
  `page_content` longtext,
  `submit_status` enum('List Now','Review and List') NOT NULL,
  `status` tinyint(1) NOT NULL COMMENT '0 for pending, 1 for approve,2 for delete, 3 for draft',
  `ebay_id` varchar(100) DEFAULT NULL,
  `ebay_price` float(11,2) DEFAULT NULL,
  `created_date` datetime NOT NULL,
  `modified_date` datetime NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

