he para-aramid-reinforced asymmetrical cable. These sweat and water resistant headphones feature SteriTouch antimicrobial ear adapters ideal for intense training sessions. The Sennheiser OCX 686i comes with a convenient storage pouch, ear adapter set and a cable clip.', '', '', '', NULL, 'Review and List', 0, NULL, NULL, '2017-10-03 14:51:51', '2017-10-03 14:51:51'),
