r Optimal Use:</b><br> â€¢ Use the included cable, your original cable or a third-party certified one (such as MFi).<br> â€¢ Compatible with the new 12 inch MacBook, 2015 (USB-C cable needed), Apple and Android smartphones, tablets (including the Nexus 7) and other USB-charged devices except for the iPod nano, iPod Classic, HP TouchPad, Dell Venue 11 Pro, Asus tablets and some GPS and Bluetooth devices.', '', '', '', NULL, 'Review and List', 0, NULL, NULL, '2017-10-04 13:39:51', '2017-10-04 13:39:51'),
